import React from 'react';
import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <section>
        <img src={logo} alt="logo" />
        <h1>Welcome Farmer John!</h1>
      </section>
    </div>
  );
}

export default App;
